import React from "react";
import "./App.css";
import Header from "./components/Header";
import Container from "./components/landing/Container";
import { BrowserRouter, Route, Switch } from "react-router-dom";

// import {} from "./slices/rootSlice";

function App() {
  return (
    <BrowserRouter>
      <div className="App" style={{ height: `${window.innerHeight}px` }}>
        {" "}
        <Header />
        <Switch>
          <Route exact path="/game" component={Container} />
          <Route path="/signup" component={Container} />
        </Switch>
        <div className="info">{`iH: ${window.innerHeight}  iW: ${window.innerWidth} `}</div>
      </div>
    </BrowserRouter>
  );
}

export default App;
